```csharp
using ESLAdmin.Features.Repositories.Interfaces;
using ESLAdmin.Features.Users.Endpoints.RegisterUser;
using ESLAdmin.Logging.Interface;
using MediatR;
using Microsoft.Extensions.Logging;

namespace ESLAdmin.Features.Users.Commands;

public class RegisterUserCommandHandler : IRequestHandler<RegisterUserCommand, RegisterUserCommandResult>
{
 private readonly IRepositoryManager _repositoryManager;
 private readonly ILogger<RegisterUserCommandHandler> _logger;
 private readonly RegisterUserMapper _mapper;

 public RegisterUserCommandHandler(
 IRepositoryManager repositoryManager,
 ILogger<RegisterUserCommandHandler> logger,
 RegisterUserMapper mapper)
 {
 _repositoryManager = repositoryManager;
 _logger = logger;
 _mapper = mapper;
 }

 public async Task<RegisterUserCommandResult> Handle(
 RegisterUserCommand command, 
 CancellationToken cancellationToken)
 {
 var request = new RegisterUserRequest
 {
 FirstName = command.FirstName,
 LastName = command.LastName,
 UserName = command.UserName,
 Password = command.Password,
 Email = command.Email,
 PhoneNumber = command.PhoneNumber,
 Roles = command.Roles
 };

 var identityResult = await _repositoryManager.AuthenticationRepository
 .RegisterUserAsync(request, _mapper);

 if (!identityResult.Succeeded)
 {
 return new RegisterUserCommandResult(
 false, 
 null, 
 identityResult.Errors.Select(e => e.Description));
 }

 return new RegisterUserCommandResult(true, identityResult.Id);
 }
}
```
</augment_code_snippet>

<augment_code_snippet path="ESLAdmin.Features/Users/Endpoints/RegisterUser/RegisterUserEndpoint.cs" mode="EDIT">
```csharp
public override async Task<Results<NoContent, ProblemDetails, InternalServerError>>
 ExecuteAsync(RegisterUserRequest request, CancellationToken cancellationToken)
{
 var command = new RegisterUserCommand(
 request.FirstName,
 request.LastName, 
 request.UserName,
 request.Password,
 request.Email,
 request.PhoneNumber,
 request.Roles);

 var result = await _mediator.Send(command, cancellationToken);

 if (!result.Succeeded)
 {
 ValidationFailures.AddRange(
 result.Errors?.Select(error => new ValidationFailure
 {
 PropertyName = "Registration",
 ErrorMessage = error
 }) ?? []);

 return new ProblemDetails(ValidationFailures, StatusCodes.Status422UnprocessableEntity);
 }

 HttpContext.Response.Headers.Append("location", $"/api/users/{request.Email}");
 return TypedResults.NoContent();
}
```
</augment_code_snippet>

## Benefits
- **Separation of concerns**: Business logic isolated in command handler
- **Testability**: Can unit test `RegisterUserCommandHandler` independently
- **Reusability**: Command can be used from other endpoints or services
- **Consistency**: Follows CQRS pattern used elsewhere in the codebase

You'll need to register MediatR in your DI container and inject `IMediator` into the endpoint constructor.
